import * as React from 'react';
import {Card, Layout} from '@shopify/polaris';
import BaseService from "../../commons/services/BaseService";
import {useEffect, useState} from "react";
import {getListUser, IResListUser} from "../../api/User";
import './index.scss';

const ListUser: React.FC<any> = () => {

    const [listUser, setListUser] = useState<IResListUser[]>([]);

    const getUsers = async () => {
        const res = await getListUser('https://fakestoreapi.com/users?page=0&limit=5');
        if (res.status === 200) {
            setListUser(res.body);
        }
    }

    useEffect(() => {
        getUsers()
    }, []);

    return (
        <div style={{display: "flex", justifyContent: "center"}}>
            <div style={{width: 1200, padding: '50px 20px'}}>
                <div style={{fontSize: 28, fontWeight: 'bold'}}>List user</div>
                <Layout>
                    {
                        listUser.map(value => {
                            return (
                                <Layout.Section >
                                    <div>
                                        <Card title="Order details" sectioned>
                                            <p>View a summary of your order.</p>
                                        </Card>
                                    </div>
                                </Layout.Section>
                            )
                        })
                    }
                </Layout>
            </div>
        </div>
    )
}

export default ListUser;
